const questions = [
    {
        "question": "Programming is ...",
        "options":[
            {
                "answer":"the result of human intelligence and coffee",
                "attribute": "creative"

            },
            {
                "answer":"a never-ending learning journey",
                "attribute": "curious"
            },
            {
                "answer":"a mysterious black hole",
                "attribute": "adventurous"
            },
            {
                "answer":"my life, my identity",
                "attribute": "passionate"
            } 
        ]
    },
    {
        "question": "I am most afraid of ...",
        "options":[
            {
                "answer":"mismatched colours and unorganized UI in websites",
                "attribute": "creative"
            },
            {
                "answer":"not learning anything in my job",
                "attribute": "curious"
            },
            {
                "answer":"refactoring a large codebase",
                "attribute": "adventurous"
            },
            {
                "answer":"my app failing every unit tests",
                "attribute": "passionate"
            } 
        ]
    },
    {
        "question": "I like it when non-techies call me ...",
        "options":[
            {
                "answer":"a magician",
                "attribute": "creative"
            },
            {
                "answer":"an AI",
                "attribute": "curious"
            },
            {
                "answer":"a hero",
                "attribute": "adventurous"
            },
            {
                "answer":"a mad genius",
                "attribute": "passionate"
            } 
        ]
    },
    {
        "question": "The beverage I can't code without is ...",
        "options":[
            {
                "answer":"latte",
                "attribute": "creative"
            },
            {
                "answer":"green tea",
                "attribute": "curious"
            },
            {
                "answer":"ice water",
                "attribute": "adventurous"
            },
            {
                "answer":"coffee",
                "attribute": "passionate"
            } 
        ]
    },
    {
        "question": "My ideal place to code is ...",
        "options":[
            {
                "answer":"at the beach",
                "attribute": "creative"
            },
            {
                "answer":"in a cafe",
                "attribute": "curious"
            },
            {
                "answer":"in a library",
                "attribute": "adventurous"
            },
            {
                "answer":"in my room",
                "attribute": "passionate"
            } 
        ]
    },
    {
        "question": "If I can only build 1 final project, it would be a ...",
        "options":[
            {
                "answer":"super awesome game",
                "attribute": "creative"
            },
            {
                "answer":"useful web/mobile app",
                "attribute": "curious"
            },
            {
                "answer":"cool machine learning/AI software",
                "attribute": "adventurous"
            },
            {
                "answer":"money-making SASS product",
                "attribute": "passionate"
            } 
        ]
    },
    {
        "question": "If I'm teaching a newbie how to code, my first lesson is ...",
        "options":[
            {
                "answer":"to teach the tools they will need",
                "attribute": "creative"
            },
            {
                "answer":"to ask student what they want to learn first",
                "attribute": "curious"
            },
            {
                "answer":"to show off what they will build after the lesson",
                "attribute": "adventurous"
            },
            {
                "answer":"to teach them Hello World first",
                "attribute": "passionate"
            } 
        ]
    },
    {
        "question": "If I am not a programmer, I would be a ...",
        "options":[
            {
                "answer":"photographer",
                "attribute": "creative"
            },
            {
                "answer":"musician",
                "attribute": "curious"
            },
            {
                "answer":"travel blogger",
                "attribute": "adventurous"
            },
            {
                "answer":"teacher",
                "attribute": "passionate"
            } 
        ]
    },
    {
        "question": "When coding, I like to listen to ...",
        "options":[
            {
                "answer":"classical or instrumental music",
                "attribute": "creative"
            },
            {
                "answer":"jazz or any soft music",
                "attribute": "curious"
            },
            {
                "answer":"rock or any loud music",
                "attribute": "adventurous"
            },
            {
                "answer":"nothing but my own thoughts",
                "attribute": "passionate"
            } 
        ]
    },
    {
        "question": "Most of the day, I think about ...",
        "options":[
            {
                "answer":"ideas for a new side project",
                "attribute": "creative"
            },
            {
                "answer":"the meaning of life",
                "attribute": "curious"
            },
            {
                "answer":"going to travel the world",
                "attribute": "adventurous"
            },
            {
                "answer":"my future",
                "attribute": "passionate"
            } 
        ]
    }
]

export default questions;
